import React from 'react';
import './Home.css';
import {
    Link
  } from "react-router-dom";
import AppsIcon from "@material-ui/icons/Apps";
import AccountCircleRoundedIcon from '@material-ui/icons/AccountCircleRounded';
import Search from './Search'

function home() {
    return (
        <div className='home'>
            <div className='home_header'>
                <div className='home_headerLeft'>
                    <Link to='/about'>About</Link>
                    <Link to='/store'>Store</Link>
                </div>
                <div className='home_headerRight'>
                    <Link to='/gmail'>Gmail</Link>
                    <Link to='/images'>Images</Link>
                    <div className ='home_headerRight_icons'>
                        <AppsIcon fontSize="large" className="gridIcon navIcon"></AppsIcon>
                        <AccountCircleRoundedIcon className="navIcon" fontSize="large"></AccountCircleRoundedIcon>
                    </div>
                </div>
            </div>

            <div className='home_body'>
                <img src="https://www.google.com/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png" alt="Google Logo"></img>

                <div className="home_inputContainer">
                    <Search />
                </div>

            </div>   
        </div>
    );
}

export default home;
